INSERT INTO `adminnotification_inbox` VALUES (1,4,'2019-05-13 08:49:27','Deprecation Notice','Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.','',0,0),(2,4,'2019-05-13 17:49:35','New Google Shopping Ads Channel Extension Available','Connect with a new, powerful Magento-developed extension for Open Source 2.2.4+ users via the Magento Marketplace: Google Shopping Ads Channel! With Google Shopping Ads Channel you can connect your Magento store with Google Merchant Center and Google Ads seamlessly; and run Smart Shopping campaigns to cost-effectively reach and convert more shoppers. Download the extension for free. ','http://marketplace.magento.com/magento-google-shopping-ads.html',0,0),(3,4,'2019-05-20 17:12:35','Seamlessly add intelligent, global shipping to your Magento store ','Provide the shipping and pickup options required to compete. Meet customer expectations, drive conversion, increase revenue, and lower abandonment. Learn more: http://bit.ly/2DtWitd','http://bit.ly/2DtWitd',0,0),(4,4,'2019-05-22 18:55:29','New Amazon Sales Channel Extension Available','Connect with a new, powerful Magento-developed extension for Open Source 2.2.4+ users via the Magento Marketplace: Amazon Sales Channel! Merchants around the world can use this extension to sell their products to millions of shoppers on the U.S., Canada, and Mexico Amazon marketplaces. The extension allows for seamless integration of your product catalog, inventory, and order information with Amazon. Download the extension for free. ','http://marketplace.magento.com/magento-module-amazon.html',0,0),(5,4,'2019-05-28 07:31:00','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\n                Online documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,0),(6,4,'2019-06-03 19:54:35','Drive cart conversion and revenue with Magento Shipping','Provide the shipping and pickup options required to compete. Meet customer expectations, drive conversion, increase revenue, and lower abandonment. Learn more: http://bit.ly/2DtWitd','http://bit.ly/2DtWitd',0,0),(7,3,'2019-06-12 01:49:34','New version 2.8.10 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.8.10\n                             ','https://magefan.com/magento2-blog-extension?version=2.8.10',0,0),(8,4,'2019-06-13 18:29:36','How low can your commerce Total Cost of Ownership go?  ','Magento provides multiple eCommerce offerings with unique benefits. The question becomes: Is your free version of Magento Open Source the best option for your business and budget? Properly evaluate the all-in costs of software, development, upkeep and support needs with this free guide: http://bit.ly/2XMWGLw','http://bit.ly/2XMWGLw',0,0),(9,1,'2019-06-25 16:09:17','Important Security and Performance Updates Released in Magento 2.3.2','The latest releases of Magento include important security enhancements along with performance and productivity improvements. We strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements and information on security updates included in these versions of Magento at our Security Center: https://magento.com/security/','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),(10,3,'2019-08-07 01:54:04','New version 2.9.0 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.9.0\n                             ','https://magefan.com/magento2-blog-extension?version=2.9.0',0,0),(11,4,'2019-10-24 08:05:51','NEW Magento 2 Alternate Hreflang Tags Extension with Better Store Switcher\n',' Do you manage Magento multi-language store without using Hreflang tags? You should definitely enable them. ','https://magefan.com/magento2-alternate-hreflang-extension',0,0),(12,3,'2019-11-06 02:12:43','New version 2.9.1 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.9.1\n                             ','https://magefan.com/magento2-blog-extension?version=2.9.1',0,0),(13,4,'2019-11-11 18:31:19','Special Offer for Open Source Customers through November 29th.','Take advantage of a special discount when you move to a Magento Commerce cloud subscription (formerly Enterprise Edition) through November 29th. With exciting new features like Page Builder and Content Staging and Preview, now is the perfect time to contact us. Link here: http://bit.ly/2O4hPNg','http://bit.ly/2O4hPNg',0,0),(14,4,'2019-11-14 16:36:56','We need your help! How do you fulfill and ship your orders?','We need your help! How do you fulfill and ship your orders?','http://selfserve.decipherinc.com/survey/selfserve/9d5/g013/191028 ',0,0),(15,1,'2019-11-26 08:35:48','35% OFF. BLACK FRIDAY SALE! Get 25% OFF any Magento 2 Extension. Use coupon code: BF2019',' Improve your store &amp; save budget today. URL: http://bit.ly/2pSs7Iz ','https://magefan.com/magento2-extensions?from=ntf-black-friday2019',0,0),(16,4,'2019-12-02 15:09:11','2020: The Year You Reimagine Your Mobile Platform','Smarter, faster mobile shopping experiences are now achievable with Progressive Web App technology. Forrester reveals how to leverage this next-generation technology, now available on Magento Commerce 2. Reimagine your mobile environment with this exclusive report.  Link here: http://bit.ly/2W5r4zg','http://bit.ly/2W5r4zg ',0,0),(17,4,'2020-02-14 09:55:53','Disable Notice','To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.','',0,0),(18,3,'2020-02-14 10:06:21','New version 2.9.2 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.9.2\n                                 ','https://magefan.com/magento2-blog-extension?version=2.9.2',0,0),(19,3,'2020-05-28 02:14:26','New version 2.9.4 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.9.4\n                                 ','https://magefan.com/magento2-blog-extension?version=2.9.4',0,0),(20,4,'2020-06-08 16:43:12','Find out why Forrester positioned Adobe as a Leader in their latest B2B commerce report.','Read why Adobe was named a Leader in the “Forrester Wave: B2B Commerce Suites, Q2 2020,” and discover how we can support your business with our global partner ecosystem. https://bit.ly/2z845hk','https://bit.ly/2z845hk',0,0),(21,4,'2020-06-11 18:19:15','Ask us your questions during our upcoming webinar, The True Cost Savings of Magento Commerce 2.','Join us on Tuesday, June 23rd, for a new session of The True Cost Savings of Magento Commerce 2 now with extended time for live Q&amp;A. John Glasgow from Adobe will share how your business can reduce operating costs and grow revenue. And Slava Kravchuk from Atwix, # 1 Contributing Partner, will share a customer case study leading the way in innovative B2B retail experiences. Register Now: https://bit.ly/3dLYlsN','https://bit.ly/3dLYlsN',0,0),(22,4,'2020-06-16 19:19:54','Your input requested: Shipping &amp; Fulfillment','We would like to get your feedback on how you think about and manage your shipping &amp; fulfillment so we can build great features for you! http://selfserve.decipherinc.com/survey/selfserve/9d5/200603','http://selfserve.decipherinc.com/survey/selfserve/9d5/200603',0,0),(23,4,'2020-06-25 21:45:31','We’re proud to be recognized as Leader in B2C commerce by Forrester in their latest report. ','Read the latest “Forrester Wave: B2C Commerce Suites, Q2 2020” report to learn why “Adobe leads with flexibility, supported by a strong global partner ecosystem.” https://bit.ly/370vz4V','https://bit.ly/370vz4V',0,0),(24,4,'2020-06-26 17:15:35','Embrace digital change with insights from eCommerce leaders at Adobe Experience Maker&#039;s Live July 22-23.','Take part in 40+ diverse sessions at Experience Makers Live July 22-23, with topics including Magento Commerce product roadmap, delivered by John Stockton, Sr. Director of Product Marketing at Adobe, customer case studies highlighting real-world applications of Magento Commerce features and functionality, and how Magento Commerce is helping merchants adapt to the challenges of a new digital reality. Register today! https://adobe.ly/3i7XGnK','https://adobe.ly/3i7XGnK',0,0),(25,4,'2020-06-30 03:34:36','NEW Magento 2 Multi-Blog Extension ',' Magento 2 Multi Blog extension is the extension that allows you to have 2 separate blogs on your Magento 2 store and manage them from one admin panel. This extension could be useful for those who already use Magento 2 Blog and want to improve their store with the second blog. ','https://magefan.com/magento-2-multi-blog-extension',0,0),(26,3,'2020-08-19 09:20:49','New version 2.9.6 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.9.6\n                                 ','https://magefan.com/magento2-blog-extension?version=2.9.6',0,0),(27,4,'2020-08-24 17:19:20','We would love your input on Magento Payments','We value the perspective of our users and we would appreciate if you took this short survey on Magento Payments. Your response will influence the design of the next generation Magento Payments solution. https://bit.ly/2CXZro2','https://bit.ly/2CXZro2',0,0),(28,4,'2020-09-14 13:33:10','Get real-time insights into the security status of the store​ with Enhanced Security Scan Tool.','The Enhanced Magento Security Scan Tool provides our on-prem and cloud merchants with real-time insights into the security status of their store by proactively notifying them if their store is vulnerable. ','https://account.magento.com/scanner ',0,0),(29,4,'2020-09-14 13:37:29','Now Available: Magento Quality Patch (MQP) tool to identify and resolve issues more quickly','The introduction of the MQP tool provides a way for you to know which quality patches are available for you installed version and apply or revert them giving you self-service access to resolve issues more quickly.','https://support.magento.com/hc/en-us/articles/360047139492-Magento-Quality-Patches-released-a-new-tool-to-self-serve-quality-patches',0,0),(30,4,'2020-09-16 18:03:56','Free 25-Point Website Evaluation for Magento Open Source Users','​Reach out to us today to get your free 25-point site assessment to identify top conversion drivers and turn your website into a conversion machine.​ Our team of experts will evaluate your site and identify specific areas for conversion improvements. https://bit.ly/3lcgILt','https://bit.ly/3lcgILt',0,0),(31,3,'2020-09-17 03:26:51','New version 2.9.6 of Magefan  Magento 2 Блог Модуль is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento-2-blog-modul?version=2.9.6\n                                 ','https://magefan.com/magento-2-blog-modul?version=2.9.6',0,0),(32,4,'2020-09-21 17:18:39','New resource updates to the Open Source page on Magento.com. ','Check out the updated Open Source page on Magento.com. Learn how to maximize your Open Source store, discover offers for Open Source merchants, and view comparison charts between Open Source and Magento Commerce. Go to page: https://adobe.ly/3kCB5jW','https://adobe.ly/3kCB5jW',0,0),(33,4,'2020-09-25 01:48:09','Don&#039;t miss Adobe Developer&#039;s Live: Commerce which brings together developers and experience builders in a one-day free conference on Monday, Sept 28th. ','The one-day free conference will feature important Magento developer updates, technical sessions and community networking opportunities. Adobe product teams across Adobe Experience Cloud will showcase the latest tech advances and developer tools powering customer experience management across industries. Register now: https://bit.ly/3hYzbrX','https://bit.ly/3hYzbrX',0,0),(34,4,'2020-09-28 22:07:26','Is Your Website Selling as Much as It Can? Watch our on-demand webinar and learn how to turn your website into a conversion machine.','Watch our on-demand webinar: Is Your Website Selling As Much As It Can? Digital Strategist Ereika Stimley and eCommerce Consultant Corey Gelato will walk you through a website self-assessment and live demo that will help you uncover opportunities to increase conversions and grow revenues. Watch now: https://bit.ly/2EAujMc','https://bit.ly/2EAujMc',0,0),(35,4,'2020-10-06 16:53:57','[Commerce Webinar] Is Your Website Ready for the 2020 Holiday Season?','Join us for a fireside chat on October 15th to learn how to prepare for the increase in web traffic during the holiday months. Anthony Potgieter, Senior Manager of E-Commerce for Wyze, and Slava Kravchuk, Founder and CEO of Atwix will discuss their top tips for succeeding this holiday season. Register today: https://bit.ly/33wzXbC','https://bit.ly/33wzXbC',0,0),(36,4,'2020-10-06 16:53:57','[Webinar] Is your site to ready to handle spikes in traffic and transactions? ','Your site speed can make or break your conversion rate this holiday season and beyond. Join us on October 15th for a fireside chat &quot;Is Your Website Ready for the 2020 Holiday Season?&quot; to learn what Commerce features you must have, and how to scale your webstore to maximize conversion rates. If you can&#039;t make the live webinar, be sure to register anyway and we&#039;ll send you the recording and slides afterward. Register today: https://bit.ly/33wzXbC','https://bit.ly/33wzXbC',0,0),(37,3,'2020-11-07 02:38:04','New version 2.9.7 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.9.7\n                                 ','https://magefan.com/magento2-blog-extension?version=2.9.7',0,0),(38,4,'2020-11-02 16:19:52','2021 Planning - reach out to us today to get your free site assessment to identify top conversion drivers.  ','Considering moving to Magento Commerce in 2021? Would you like a demo or free site assessment? Our team of experts would love to help. Get started now. https://bit.ly/3lcgILt','https://bit.ly/3lcgILt',0,0),(39,1,'2020-11-04 14:28:07','Please help prioritize our roadmap - SHORT survey','We are looking to better understand how we can help you manage all of your digital ecommerce from one place. Please help us prioritize our roadmap! Very short survey is here! http://selfserve.decipherinc.com/survey/selfserve/9d5/201000','http://selfserve.decipherinc.com/survey/selfserve/9d5/201000',0,0),(40,3,'2022-07-21 04:26:32','New version 2.10.9 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.10.9\n                                 ','https://magefan.com/magento2-blog-extension?version=2.10.9',0,0),(41,4,'2022-07-26 16:18:18','Expanded video library on the Adobe Commerce Experience League','Check out our expanded video library on the Adobe Commerce Experience League that now has a set of 35 short demo videos of our core Adobe Commerce capabilities and support tools.','https://experienceleague.adobe.com/docs/commerce-learn/tutorials/overview.html?lang=en',0,0),(42,3,'2023-04-17 06:36:26','New version 2.10.13 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.10.13\n                                 ','https://magefan.com/magento2-blog-extension?version=2.10.13',0,0);
