INSERT INTO `cms_page` VALUES (1,'404 Not Found','2columns-right','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2019-05-13 08:49:25','2020-10-28 08:30:14',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Home page','1column','magento hitech theme, magento 17 theme, responsive theme, responsive magento theme, digital store, accessories store, supermarket store, clean design theme','Smartech is an elegant Magento 2 Theme with attractive homepage layout and powerful eCommerce features. Beauty is suitable for supermarket, digital/hitech store, jewelry store or accessories store...','home-demo-01','','<div class=\"container clearfix\">\r\n	<div class=\"slideshow-banner\">\r\n			<div class=\"slidershow-container\">\r\n				<div class=\"slidershow-content\">\r\n					<div class=\"slider-show nav-style-1 nav-style-1-slidershow-big dot-style-1 hover-to-show\">\r\n						<div data-owl=\"owl-slider\" data-autoplay=\"true\" data-nav=\"false\" data-dots=\"true\" data-screen0=\"1\" data-screen481=\"1\" data-screen768=\"1\" data-screen992=\"1\" data-screen1200=\"1\" data-screen1441=\"1\" data-scree